import Header from "../components/Header";
import Footer from "../components/Footer";
import { Col, Row, Container } from "../components/Grid";

function About () {
    return (
        <div>
            <Header />
            <Container>
                <Row>
                    <Col size="md-12"><h1>About Me</h1></Col>
                </Row>
                <Row></Row>
                <Row></Row>

            </Container>
            <Footer />
        </div>
    )
}

export default About;
